import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { HttpService } from 'src/app/service/http.service';

@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.scss']
})
export class HeaderComponent {
constructor(public http:HttpService,private router:Router){}
logout(){
  localStorage.removeItem('token')
  this.router.navigate(['/login'])
}
}
<div class="header" >
    <div class="logo">
        <h2>Joselu</h2>
    </div>
    <div class="links">
        <ul>
            <li routerLinkActive="active"><a href="" routerLink="home" >Home</a></li>
            <li routerLinkActive="active"><a href="" routerLink="About">About</a></li>
            <li routerLinkActive="active"><a href="" routerLink="privacy">Privacy</a></li>
            <li routerLinkActive="active" *ngIf="http.isLoggedIn()==false"><a href="" routerLink="login"  >Login</a></li>
            <li routerLinkActive="active" *ngIf="http.isLoggedIn()==false"><a href="" routerLink="regeister" >Regeister</a></li>
            <li  *ngIf="http.isLoggedIn()==true" [routerLink]="['/author'+http.getAuthorDataFromToken().id]">my profile</li>
            <li *ngIf="http.isLoggedIn()==true" >Logout</li>
        </ul>
        </div>
</div>
